import React from 'react'
import {Link} from 'react-router-dom'
import {  StyledLogInButton, StyledLogOutButton, StyledAddButton, StyledSmallButton, update } from '../Style/StyledButtons'

export default function Button({handleClick, label, del, logOut, to, create, login, back, edit, add, update}) {
    return (
        <>
            {login && 
                <StyledLogInButton login={true}>
                    {label}
                </StyledLogInButton>
            }
            
            {del && 
            <StyledSmallButton onClick={del} del={true}>
                    {label}
            </StyledSmallButton>
            }

            {logOut && 
                <Link to={to}>
                    <StyledLogOutButton logOut={true}>
                        {label}
                    </StyledLogOutButton>
                </Link>
            }
            {create && 
                <Link to={to}>
                    <StyledSmallButton onClick={handleClick} create={true}>
                            {label}
                    </StyledSmallButton>
                </Link>
            }
            {add && 
                <Link to={to}>
                    <StyledAddButton add={true}>
                            {label}
                    </StyledAddButton>
                </Link>
            }
            {back && 
                <Link to={to}>
                    <StyledSmallButton back={true}>
                            {label}
                    </StyledSmallButton>
                </Link>
            }
            {edit && 
                <Link to={to}>
                    <StyledSmallButton edit={true}>
                            {label}
                    </StyledSmallButton>
                </Link>
            }  

            {update && 
                <Link to={to}>
                    <StyledSmallButton handleClickupdate={true}>
                            {label}
                    </StyledSmallButton>
                </Link>
            }   
        </>
    )
}
